function Datacard(ID, DATA, AVAIL, SPEC, YEAR, COST, CARDS, PROTO, NATION, NAME){
  //set on construct
  this.iUnitID = ID;
  this.sNameU = NAME;
  this.sNation = NATION;
  this.sUnitData = DATA;
  this.iaAvailability = AVAIL; //[5]
  this.sSpecDeck = SPEC;
  this.iYear = YEAR;
  this.iCost = COST;
  this.iCards = CARDS;
  this.iIsProto = PROTO;
  //set on traits
  this.iHP = "";
  this.iSize = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig. 0,10+ is ECM
  this.iOptics = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig, 0,10+ is ECM
  this.iSpeed = "";
  this.iRSpeed = "";
  this.iASpeed = "";
  this.iTraining = ""; // 1-2-3-4, militia, line, shock, elite,
  this.iStealth = ""; //1-2-3-4-5, poor-med-good-vgood-exc,
  this.iAutonomy = 0;
  this.iaArmor = [0,0,0,0];
  //set on Weaponize
  this.W1 = [0,0];
  this.W2 = [0,0];
  this.W3 = [0,0];
}

function VehicleCard(VET, UNIT, TRANSPORT, CRAFT){
    this.sVeterancy = VET; // expected binary
    this.iVet = parseInt(VET,2);
    this.iVet0 = this.iVet; //normalized
    this.sNation = UNIT.sNation; //trusting the database here
    if(TRANSPORT == 0){ this.iYear = UNIT.iYear;} else {this.iYear = UNIT.iYear < TRANSPORT.iYear ? UNIT.iYear : TRANSPORT.iYear;} //landing craft are not limiting here IIRC
    this.sSpec = "1111111";
    if (TRANSPORT != 0 && CRAFT == 0) { //naval is unlimited
      this.sSpec = "";
      for (var i = 0; i < 7; i++){
        if (UNIT.sSpecDeck.charAt(i) == '0' || TRANSPORT.sSpecDeck.charAt(i) == '0') { this.sSpec += '0'; } else {this.sSpec += '1'; } //"JS strings are immutable" WTF?!?
      }
    }
    if (TRANSPORT == 0 && CRAFT == 0) { this.iCost = UNIT.iCost;} else
    if (TRANSPORT != 0 && CRAFT == 0) {this.iCost = UNIT.iCost + TRANSPORT.iCost; } else
    {this.iCost = UNIT.iCost + TRANSPORT.iCost + CRAFT.iCost;} //<<need to actually add the landing craft data
    if (UNIT.iIsProto == 1 || (TRANSPORT == 0 || TRANSPORT.iIsProto == 1)) { this.iIsProto = 1; }
    this.iArrayIndex = ""; //for deck pos tracking
    this.iDeckIndex = ""; //same
    this.iaAvailability = [];
    if (TRANSPORT == 0) {this.iaAvailability = UNIT.iaAvailability;} else {
      for (var i = 0; i < 5; i++){
          this.iaAvailability[i] = UNIT.iaAvailability[i] < TRANSPORT.iaAvailability[i] ? UNIT.iaAvailability[i] : TRANSPORT.iaAvailability[i];
      }
    }
    this.Unit = UNIT;
    this.Transport = TRANSPORT;
    this.Craft = CRAFT;
}


function Traits(Card, HP, SIZE, OPTICS, SPEED, RSPEED, ASPEED, TRAINING, STEALTH, AUTON, AV) {
  Card.iHP = HP;
  Card.iSize = SIZE;
  Card.iOptics = OPTICS;
  Card.iSpeed = SPEED;
  Card.iRSpeed = RSPEED;
  Card.iASpeed = ASPEED;
  Card.iTraining = TRAINING;
  Card.iStealth = STEALTH;
  Card.iAutonomy = AUTON;
  Card.iaArmor = AV;
}

function initMainDB()
{
    window.MainArmory = [];
    WeaponDataLoad();
    Create();
    Mobilize();
    Weaponize();
}

